import React from "react";
import TypeProduct from "../../components/TypeProduct/TypeProduct";

const HomePage = () => {
  const arr = ["xe", "TX"];
  return (
    <div style={{ padding: "0 120px" }}>
      <WrapperTypeProduct>
        {arr.map((item) => {
          return <TypeProduct name={item} key={item} />;
        })}
      </WrapperTypeProduct>
      HomePage
    </div>
  );
};

export default HomePage;
